import Header from "./Header";
import Navbar from "./Navbar";
import Footer from "./Footer";

const Layout = ({ children, title = "Community Project", pageTitle = "" }) => {
  return (
    <div className="parent">
      <Header title={title} />
      <Navbar />
      {children}
      <Footer />
    </div>
  );
};

export default Layout;
